const result = [];

for (const item of $input.all()) {
  const raw = item.json.output || "";

  // Initialize parsed as an empty object
  let parsed = {};

  // Check if the input contains structured text with Script and Image Prompts
  if (typeof raw === 'string' && raw.includes('**Script:**') && raw.includes('**Image Prompts:**')) {
    try {
      // Split the raw input into Script and Image Prompts sections
      const [scriptSection, imagePromptsSection] = raw.split('**Image Prompts:**').map(s => s.trim());

      // Parse Script section
      const scriptLines = scriptSection
        .replace('**Script:**', '')
        .trim()
        .split('\n')
        .filter(line => line.match(/^\d+\.\s/)) // Keep lines starting with "1.", "2.", etc.
        .map(line => line.replace(/^\d+\.\s/, '').replace(/^"(.*)"$/, '$1')); // Remove numbering and quotes

      // Parse Image Prompts section
      const imagePromptsLines = imagePromptsSection
        .trim()
        .split('\n')
        .filter(line => line.match(/^\d+\.\s/))
        .map(line => line.replace(/^\d+\.\s/, '')); // Remove numbering

      // Create parsed object
      parsed = {
        script: scriptLines,
        image_prompts: imagePromptsLines
      };
    } catch (err) {
      result.push({ json: { error: "Failed to parse structured text", raw } });
      continue;
    }
  } else {
    // Try parsing as JSON if it's not the structured text format
    try {
      const match = raw.match(/```(?:json)?\s*([\s\S]*?)\s*```/i);
      const jsonString = match ? match[1] : raw;
      parsed = JSON.parse(jsonString);
    } catch (err) {
      result.push({ json: { error: "Invalid JSON format", raw } });
      continue;
    }
  }

  // Loop over keys: script, image_prompts
  for (const key of Object.keys(parsed)) {
    const values = parsed[key];

    if (Array.isArray(values)) {
      for (const value of values) {
        result.push({
          json: {
            type: key,
            value: value
          }
        });
      }
    } else if (typeof values === 'object') {
      // If it's an object like { "1": "...", "2": "..." }
      const ordered = Object.keys(values).sort((a, b) => Number(a) - Number(b));
      for (const k of ordered) {
        result.push({
          json: {
            type: key,
            value: values[k]
          }
        });
      }
    } else {
      // Handle primitive values
      result.push({
        json: {
          type: key,
          value: values
        }
      });
    }
  }
}

return result;

return items.map(item => {
    const assContent = item.json.assContent;
    const originalFileName = item.json.fileName || 'unknown_file';

    if (!assContent) {
        console.warn(`Warning: 'assContent' not found for item ${originalFileName}. Skipping modification.`);
        return item;
    }

    try {
        console.log(`Processing content for: ${originalFileName}`);
        const lines = assContent.split('\n');
        const modifiedLines = [];
        let inEventsSection = false;

        for (const line of lines) {
            if (line.trim() === '[Events]') {
                inEventsSection = true;
                modifiedLines.push(line);
                continue;
            }
            if (inEventsSection && line.startsWith('Dialogue:')) {
                let modifiedLine = line.replace(/You have to try/i, 'New text here'); // Match current text
                modifiedLines.push(modifiedLine);
                continue;
            }
            modifiedLines.push(line);
            if (line.trim().startsWith('[') && line.trim() !== '[Events]') {
                inEventsSection = false;
            }
        }

        const modifiedContent = modifiedLines.join('\n');
        item.json.modifiedAssContent = modifiedContent;
        console.log(`Modified content for: ${originalFileName}: ${modifiedContent.substring(0, 100)}...`); // Log preview
        return item;
    } catch (error) {
        console.error(`Error modifying content for ${originalFileName}:`, error.message);
        item.json.error = `Error processing file: ${error.message}`;
        return item;
    }
});
